/*Table structure for table `subquestion` */

DROP TABLE IF EXISTS `subquestion`;

CREATE TABLE `subquestion` (
  `C_id` varchar(10) default NULL,
  `tablename` varchar(20) default NULL,
  KEY `FK_subquestion_coursesoffered` (`C_id`),
  CONSTRAINT `FK_subquestion_coursesoffered` FOREIGN KEY (`C_id`) REFERENCES `coursesoffered` (`CourseID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `subquestion` */

insert  into `subquestion`(`C_id`,`tablename`) values ('100','DS'),('101','TOC'),('102','CN'),('103','OS'),('104','ADA'),('105','DBMS');

/*Table structure for table `toc` */

DROP TABLE IF EXISTS `toc`;

CREATE TABLE `toc` (
  `Q_id` int(4) default NULL,
  `Question` varchar(250) default NULL,
  `A` varchar(50) default NULL,
  `B` varchar(50) default NULL,
  `C` varchar(50) default NULL,
  `D` varchar(50) default NULL,
  `Answer` char(2) default 'A'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `toc` */

insert  into `toc`(`Q_id`,`Question`,`A`,`B`,`C`,`D`,`Answer`) values (1,'What is TOC?','Theory of Computation','Theory of Computers','Theory of Concrete','None of these','A'),(2,'sgsgs','adfdfzd','adfaef','aadfh','jh','C');

/*Table structure for table `videos` */

DROP TABLE IF EXISTS `videos`;

CREATE TABLE `videos` (
  `CID` varchar(10) default NULL,
  `Link` varchar(1000) default NULL,
  `Name` varchar(50) default NULL,
  KEY `FK__courses` (`CID`),
  CONSTRAINT `FK_videos_coursesoffered` FOREIGN KEY (`CID`) REFERENCES `coursesoffered` (`CourseID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

